import Post from '../post/post'
import Share from '../share/share'
import './feed.css'
import {Posts} from "../../dummyData"

function Feed() {
    return (
        <div className="feed">
            <div className="feedWrapper">
                <Share/>
               {
                   Posts.map((post)=>(<Post key={post.id} p={post}/>))
               }
            </div>
        </div>
    )
}

export default Feed
